
public class twoLoop1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
       int i,j;
       for(i=1;i<=5;i++)
       {
    	   for(j=1;j<=3;j++)
    	   {
    		   System.out.println(i+"  "+j);
    	   }
       }
       
       
       for(i=1;i<=9;i++)
       {
    	   for(j=1;j<=9;j++)
    	   {
    		   System.out.println(i+"*"+j+"="+i*j);
    	   }
       }
	}

}
